import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Add an item to the cart to enable the remove functionality
    await page.waitForSelector('button.add-to-cart', { timeout: 5000 });
    await page.locator('button.add-to-cart').first().click();

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_item_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_item_added.png'));

    // 2. Open the cart modal
    await page.waitForSelector('div.cart', { timeout: 5000 });
    await page.locator('div.cart').click();

    // 3. Wait for the cart item to be visible and take a screenshot
    await page.waitForSelector('.cart-item', { state: 'visible', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_with_item.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_with_item.png'));

    // 4. Click the remove button for the item
    await page.waitForSelector('button.remove-item', { timeout: 5000 });
    await page.locator('button.remove-item').first().click();

    // 5. Verify the cart is now empty
    await page.waitForSelector('.empty-cart', { state: 'visible', timeout: 5000 });
    const emptyCartText = await page.locator('.empty-cart').textContent();

    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_item_removed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_item_removed.png'));

    return {
      success: true,
      action: "Successfully removed an item from the cart.",
      extractedData: {
        emptyCartMessage: emptyCartText
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to remove item from cart",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
